#define EMBEDDED_SAMPLE_COUNT 6

// Load all embedded samples into the sampler engine
// Returns the number of samples loaded
static int loadEmbeddedSamples(void) {
    _ensureSamplerCtx();
    int loaded = 0;
    for (int i = 0; i < EMBEDDED_SAMPLE_COUNT && i < SAMPLER_MAX_SAMPLES; i++) {
        const EmbeddedSample* e = &embeddedSamples[i];
        Sample* s = &samplerCtx->samples[i];
        
        // Point to embedded data (no copy needed, it's const)
        memcpy(&s->data, &e->data, sizeof(s->data));  // Assign const ptr to non-const field - data is read-only
        s->length = e->length;
        s->sampleRate = e->sampleRate;
        s->loaded = true;
        s->embedded = true;  // Don't free this data
        strncpy(s->name, e->name, sizeof(s->name) - 1);
        s->name[sizeof(s->name) - 1] = '\0';
        loaded++;
    }
    return loaded;
}

// Get embedded sample info by index
static const EmbeddedSample* getEmbeddedSampleInfo(int index) {
    if (index < 0 || index >= EMBEDDED_SAMPLE_COUNT) return NULL;
    return &embeddedSamples[index];
}

